import React from 'react'


const TagList = ({tags}) => {
    console.log(tags)
    return (
        <ul className='article__tag-list'>
            {tags.map((tag, index) => {
                return <li key={tag} className="article__tag-item">{tag}</li>
            })}
        </ul>
    )
    
    
}

export default TagList